import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View} from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
import Title_Media from './src/components/Title_media/index'
import Title_Valores from './src/components/Title_valores/index'
import Header from './src/components/Header/index'

import Form_media from './src/content/Form_media/index'
import Form_valores from './src/content/Form_valores/index'
import { LinearGradient } from 'expo-linear-gradient';

export default function App() {
  return (

    <LinearGradient>

    <View style={styles.container}>

      <Header/>

      <Icon name="solution" size={60} color="#900" />

      <Title_Media/>

      <Form_media/>

      <Icon name="calculator" size={60} color="#900" />

      <Title_Valores/>

      <Form_valores/>

     <View>
      <Icon name="whatsapp" size={60} color="#900" style={styles.icones} />
      <Icon name="facebook" size={60} color="#900"  style={styles.icones}/>
      <Icon name="instagram" size={60} color="#900"  style={styles.icones}/>
     </View>

    </View>

    </LinearGradient>

  );
}

const styles = StyleSheet.create({

  icones: {

    flex: 1,
    flexDirection: 'Row',
    alignItems: 'center', 

  },

  container: {

    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',

  },
});
